const InterpolationType = {
  NEAREST: 0,
  LINEAR: 1,
  FAST_LINEAR: 2
};
const OpacityMode = {
  FRACTIONAL: 0,
  PROPORTIONAL: 1
};
var Constants = {
  InterpolationType,
  OpacityMode
};

export { InterpolationType, OpacityMode, Constants as default };
